import { NgModule } from '@angular/core';
import { CommonModule } from '@angular/common';
import { Routes } from '@angular/router';
import { loadRemoteModule } from '@angular-architects/module-federation';

const routes: Routes = [
  {
    path: '',
    loadChildren:()=> loadRemoteModule({type: 'module', remoteEntry: 'http://localhost:4201/remoteEntry.js', exposedModule: './ComponentModule'}).then((mf1) => mf1.ComponentModule) 
  }
]

@NgModule({
  declarations: [],
  imports: [
    CommonModule
  ]
})
export class AppRoutingModule { }
